import styled from 'styled-components/native';

export const TextConta = styled.Text`
    font-size: 16px;
    text-align: center;
    margin-top: 8%;
`;

export const LoginButton = styled.TouchableOpacity`
    margin-left: 3px;
`;

export const TextLogin = styled.Text`
    color: #4C6793;
`;
